deliveryText:
• Delivery service is available in Buzmeyin and Anau as well as in Ashgabat. The service is free of charge; 

• The total cost of each order should be at least 50 manats; 

• After you order from the site, the operator will call you and confirm the order (if you are a regular customer, your orders will also be confirmed automatically as you wish); 

• The service is based on your email address and phone number; Make sure you get a call from the phone number you entered to confirm the order. Also, check that the address you entered is correct; 

• Payment is made after you have verified the order. Your bill of lading is set out in the supplier's bill of lading. Payment is made in cash and non-cash in national currency. The goods you received and paid will not be refunded;
